import React, { Component } from 'react';

class pannel extends Component {
    render() {
        return (
            <div>
                <section className='video-container'>
                <img src='https://picsum.photos/400/200' style={{borderRadius:'30px'}} />
                </section>
            </div>
        );
    }
}

export default pannel;
